Trzek () is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Kostrzyn"&gt;Gmina Kostrzyn&lt;/a&gt;, within &lt;a href="Pozna%C5%84%20County"&gt;Poznań County&lt;/a&gt;, &lt;a href="Greater%20Poland%20Voivodeship"&gt;Greater Poland Voivodeship&lt;/a&gt;, in west-central Poland. It lies approximately south-west of &lt;a href="Kostrzyn"&gt;Kostrzyn&lt;/a&gt; and east of the regional capital &lt;a href="Pozna%C5%84"&gt;Poznań&lt;/a&gt;.
